import React from "react";
import { Link, Outlet } from "react-router-dom";
import { useAppContext } from "../../context/appContext";

const Dashboard = () => {
  const { user } = useAppContext();
  return (
    <div>
      <h1>Dashboard: Hello {user.name}</h1>
      <Outlet />
    </div>
  );
};

export default Dashboard;
